import React from 'react';

import Form from '../../components/form';
import Layout from '../../components/main/Layout';

export default function LoginPage() {
    return (
        <Layout>
            <form className="w-full sm:w-[500px]">
                <h1>Let's Chat!</h1>
                <Form.FormInput />
                <Form.FormInput type="email" className="py-2" placeholder='Username' />
                <Form.FormInput type="password" className="py-2" placeholder='Email' />
                <Form.Button title="Submit" className='my-6' />
            </form>
        </Layout>
    );
}
